import Navbar from "./Header";

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const Layout = LandingPage => {
  return () => (
    <div>
      <Navbar />
      <LandingPage />
    </div>
  );
};

export default Layout;
